import * as React from "react";
import Particles from "react-tsparticles";
import "./styles.css";

export default function ParticleSettings() {
  return (
    <div className="App">
      <Particles
        params={{
          fpsLimit: 2,
          particles: {
            color: {
              value: "#000"
            },
            links: {
              enable: true,
              color: "#000",
              distance: 150
            },
            move: {
              enable: true
            }
          }
        }}
      />
    </div>
  );
}
